import React from "react";

function Home() {
  return (
    <div class="container1">
    <div class="left-side">
        <div class="title">
            Bienvenue
        </div>
        <div class="pg">
            Serveur d'administration des données pour les enquêtes HCERES
        </div>
    </div>
    <div class="right-side">
        <img class="labo" src="images/welcomImg.png" />
    </div>
</div>

  );
}

export default Home;
